import React from 'react';
import { Button } from 'antd';
import 'antd/dist/antd.css';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Button type="primary">Button</Button>

      </header>
    </div>
  );
}

export default App;
